import React from "react";
import { Typography, Button } from "@material-ui/core";
import LoginTextField from "./LoginTextField";
import { withStyles } from "@material-ui/core/styles";

const Home = () => {

  const Title = withStyles({
    root: {
      color: "#7C3AED"
    }
  })(Typography);

   return (
    <div class="h-full">
      <form class="h-full flex flex-wrap content-center justify-center flex-col" noValidate autoComplete="off">
        <div class="text-center">
          <Title variant="h2" colorPrimary="white">AutoSend</Title>
        </div>
        <div class="w-96 mt-5">
          <LoginTextField label="Email" variant="outlined" fullWidth="true"/>
        </div>
        <div class="w-96 mt-3">
          <LoginTextField label="Password" variant="outlined" fullWidth="true"/>
        </div>
        <div>
          <Button variant="contained">Testing</Button>
        </div>


      </form>
    </div>
  );
};

export default Home;
